import React from 'react';
import '../style/footer.css';
import linkedin from '../rs/logolinkedin.webp';
import github from '../rs/githublogo.png';

const Footer = () => {
  return (
    <footer className="footer">
      <h2>Mes RÃ©seaux :</h2>
      <div className="LogoLinkedin">
        <a href="https://www.linkedin.com/in/mathis-coutaye-a8b6432bb">
            <img src={linkedin} alt="LogoLinkedin" href="google.com"/>
        </a>
      </div>
      <div className="LogoGithub">
        <a href="https://github.com/mcoutaye">
            <img src={github} alt="LogoGithub" href="google.com"/>
        </a>
      </div>
    </footer>
  );
}

export default Footer;
